'use strict'

window.onload = function(){
  var canvas = document.getElementById("canvas");
  var nextCanvas = document.getElementById("next-canvas");

  var click = new Click(canvas, nextCanvas);
  canvas.onmousedown = click.down;
  canvas.onmouseup = click.up;
  canvas.onmousemove = click.move;
  canvas.onmouseout = click.out;
  canvas.addEventListener("touchstart", click.down);
  canvas.addEventListener("touchend", click.up);
  canvas.addEventListener("touchmove", click.move);

  var draw = new Draw(canvas, nextCanvas);
  draw.first();
  draw.next();
}

function Click(canvas, nextCanvas){
  var isDown = false;
  var canvas = canvas;
  var nextCanvas = nextCanvas;

  var windowToCanvas = function(e){
    var bbox = canvas.getBoundingClientRect();
    return {x: parseInt(e.clientX-bbox.left), y: parseInt(e.clientY-bbox.top)};
  };
  var scratcher = function(point){
    var ctx = canvas.getContext("2d");
    var nextCtx = nextCanvas.getContext("2d");
    var imageData = ctx.getImageData(0, 0, ctx.canvas.width, ctx.canvas.height);
    var nextImageData = nextCtx.getImageData(0, 0, nextCtx.canvas.width, nextCtx.canvas.height);
    var pixelData = imageData.data;
    var nextPixelData = nextImageData.data;
    console.log(point.x+", "+point.y);
    for(var col=-15; col<=15; col++)
      for(var row=-15; row<=15; row++){
        if(parseInt(Math.sqrt(row*row+col*col))<=15){
          var y = point.x + col;
          var x = point.y + row;
          if(x>=0 && x<=ctx.canvas.height && y>=0 && y<=ctx.canvas.width){
            var p = (x*ctx.canvas.width + y)*4;
            pixelData[p+0] = nextPixelData[p+0];
            pixelData[p+1] = nextPixelData[p+1];
            pixelData[p+2] = nextPixelData[p+2];
            pixelData[p+3] = nextPixelData[p+3];
          }
        }
      }

    ctx.putImageData(imageData, 0, 0, 0, 0, ctx.canvas.width, ctx.canvas.height);

  };

  this.down = function(e){
    e.preventDefault();
    isDown = true;
    if(e.touches)
      e = e.touches[0];
    var point = windowToCanvas(e);
    scratcher(point);
  };
  this.up = function(e){
    e.preventDefault();
    isDown = false;
  };
  this.move = function(e){
    e.preventDefault();
    if(isDown){
      if(e.touches)
        e = e.touches[0];
      var point = windowToCanvas(e);
      scratcher(point);
    }
  };
  this.out = function(e){
    e.preventDefault();
    isDown = false;
  };
}

function Draw(canvas, nextCanvas){
  var canvas = canvas;
  var nextCanvas = nextCanvas;
  canvas.width = nextCanvas.width = window.innerWidth;
  canvas.height = nextCanvas.height = window.innerHeight;

  this.first = function(){
    var ctx = canvas.getContext("2d");
    var location = {
      x: ctx.canvas.width/2,
      y: ctx.canvas.height/3
    };
    
    ctx.save();
    ctx.translate(location.x, location.y);
    ctx.fillStyle = "222";
    ctx.textAlign = "center";
    ctx.textBaseline = "middle";
    ctx.font = "lighter 50px cursive,sans-serif";
    ctx.fillText("404", 0, 0);
    ctx.fillText("Not Found", 0, 60);
    ctx.restore();
  };

  this.next = function(){
    var ctx = nextCanvas.getContext("2d");
    
    var img = new Image();
    img.src = "data:image/png;base64,";
    
    function getScale(img){
      var scale = 1/2 * window.innerHeight / img.height;
      return {width: img.width*scale, height: img.height*scale};
    }
    var info = getScale(img);
    var location = {
      x: ctx.canvas.width*3/5-info.width/2,
      y: ctx.canvas.getBoundingClientRect().top+info.height/3
    };
    
    ctx.drawImage(img, 0, 0, img.width, img.height, location.x, location.y, info.width, info.height);
    if(location.x-info.width > 0)
      ctx.drawImage(drawImgTooltip(info.height), location.x-info.width, location.y);
    else
      ctx.drawImage(drawFontTooltip(info.width), location.x, location.y+info.height);
  };
 
  var drawFontTooltip = function (imgWidth){
    var scale = (Math.sqrt(5)-1)/2;
    var info = {
      scale: scale,
      width: imgWidth,
      height: imgWidth*scale
    };
    
    var canvas = document.createElement("canvas");
    var ctx = canvas.getContext("2d");
    
    canvas.width = canvas.height = imgWidth + 20;
    drawFontContext(ctx, info);
    
    return canvas;
  };
  var drawFontContext = function (ctx, info){
    ctx.save();
	 	
    ctx.scale(info.width, info.height);
    ctx.beginPath();
    ctx.moveTo(0, info.scale/6);
    ctx.arcTo(0, 0, 1/6, 0, 1/6*info.scale);
    ctx.lineTo(5/6, 0); 
    ctx.arcTo(1, 0, 1, 1/6*info.scale, 1/6*info.scale);
    ctx.lineTo(1, 5/6*info.scale);
    ctx.arcTo(1, info.scale, 5/6, info.scale, 1/6*info.scale);
    ctx.lineTo(1/6, info.scale);
    ctx.arcTo(0, info.scale, 0, 5/6*info.scale, 1/6*info.scale);
    ctx.lineTo(0, info.scale/6);
    ctx.closePath();
    
    ctx.restore();
    ctx.stroke();
    
    var size = parseInt(info.scale*info.height*2/5);
    
    ctx.save();
    ctx.fillStyle = "#222";
    ctx.textAlign = "center";
    ctx.textBaseline = "center";
    ctx.font = "lighter " + size+"px" + " cursive,sans-serif";
    ctx.fillText("404", info.width/2, size);
    ctx.fillText("...", info.width/2, 2*size);  
    ctx.restore();
  };

  var drawImgTooltip = function(imgHeight){
    var scale = (Math.sqrt(5)-1)/2;
    var base = imgHeight - 20;
    var small = base - base*scale*scale*2;
    var info = {
    	scale: scale,
    	left: 20, 
    	top: 10, 
    	largeWidth: base*scale,
    	largeHeight: base,
    	middleWidth: base*scale,
    	middleHeight: base*Math.pow(scale,2),
    	smallWidth: small*scale, 
    	smallHeight: small
	  };

 	 	var canvas = document.createElement("canvas");
    var ctx = canvas.getContext("2d");

    canvas.width = canvas.height = imgHeight;

    drawFrame(ctx, info);
    draw404(ctx, info);
    drawFont(ctx, info);

    return canvas;
  };

  var drawFrame = function(ctx, info){
    var vertex = { 
      topLeft: {
        x: info.left-35,
        y: info.top
      },
      topRight: {
        x: info.left+info.largeWidth+35,
        y: info.top
      },
      middleLeft: {
        x: info.left, 
        y: info.top+info.largeHeight/2
      },
      middleRight: {
        x: info.left+info.largeWidth,
        y: info.top+info.largeHeight/2
      },
      bottomLeft: {
        x: info.left,
        y: info.top+info.largeHeight
      },
      bottomMiddle: {
        x: info.left+info.largeWidth/2,
        y: info.top+info.largeHeight
      },
      bottomRight: {
        x:info.left+info.largeWidth,
        y:info.top+info.largeHeight
      }
    };
  
    ctx.save();
  
    ctx.beginPath();
    ctx.moveTo(vertex.middleLeft.x , vertex.middleLeft.y);
    ctx.bezierCurveTo(vertex.topLeft.x, vertex.topLeft.y, vertex.topRight.x, vertex.topRight.y, vertex.middleRight.x, vertex.middleRight.y);

    ctx.moveTo(vertex.middleLeft.x, vertex.middleLeft.y);
    ctx.quadraticCurveTo(vertex.bottomLeft.x, vertex.bottomLeft.y, vertex.bottomMiddle.x, vertex.bottomMiddle.y);
    ctx.quadraticCurveTo(vertex.bottomRight.x, vertex.bottomRight.y, vertex.middleRight.x, vertex.middleRight.y);

    ctx.lineJoin = "round";
    ctx.lineCap = "round";
    ctx.lineWidth = 6;
    ctx.strokeStyle = "rgba(77, 77, 77, 0.25)";
    ctx.fillStyle = "rgba(240, 240, 240, 0.75)";
  
    ctx.stroke();
    ctx.fill();
  
    ctx.restore();
  };
  var draw404 = function(ctx, info){
    ctx.save();

    ctx.lineWidth = 10;
    ctx.lineCap = "round";
    ctx.lineJoin = "round";
    ctx.strokeStyle = "#444";
    drawNose(ctx, info);
    drawEyes(ctx, info);

    ctx.restore();
  };
  var drawNose = function(ctx, info){
    var matrix = [
      [
        info.smallWidth/2*info.scale,
        0,
        info.left+info.largeWidth/2
      ],
      [
        0,
        info.smallHeight/2*info.scale,
        info.top+info.largeHeight/2
      ]
    ];

    ctx.save();
  
    ctx.save();
    ctx.transform(matrix[0][0], matrix[1][0], matrix[0][1], matrix[1][1], matrix[0][2], matrix[1][2]);
    ctx.beginPath();
    ctx.arc(0, 0, 1, 0, 2*Math.PI);
    ctx.restore();
    ctx.stroke();

    ctx.restore();
  };
  var drawEyes = function(ctx, info){
    var height = info.height - info.width*info.scale*2;
  
    var leftLocation = {
      x: info.left+(info.largeWidth-info.smallWidth*3)/2,
      y: info.top+info.middleHeight-info.smallWidth
    };
    var leftMatrix = [
      [
        info.smallWidth,
        0,
        leftLocation.x
      ],
      [
        0,
        info.smallHeight,
        leftLocation.y
      ]
    ];
  
    var rightLocation = {
      x: info.left+(info.largeWidth+info.smallWidth*3)/2,
      y: leftLocation.y
    };
    var rightMatrix = [
      [
        -info.smallWidth,
        0,
        rightLocation.x
      ],
      [
        0,
        info.smallHeight,
        rightLocation.y
      ]
    ];

    drawEye(ctx, leftMatrix, info.scale);
    drawEye(ctx, rightMatrix, info.scale);
  };
  var drawEye = function(ctx, matrix, scale){
    ctx.save();
    ctx.transform(matrix[0][0], matrix[1][0], matrix[0][1], matrix[1][1], matrix[0][2], matrix[1][2]);
    ctx.beginPath();
    ctx.moveTo(0, 0);
    ctx.lineTo(0, scale);
    ctx.lineTo(1, scale);
    ctx.restore();
    ctx.stroke();
  
    ctx.save();
    ctx.transform(matrix[0][0], matrix[1][0], matrix[0][1], matrix[1][1], matrix[0][2], matrix[1][2]);
    ctx.beginPath();
    ctx.moveTo(scale, 0);
    ctx.lineTo(scale, 1);
    ctx.restore();
    ctx.stroke();
  };
  var drawFont = function(ctx, info){
    ctx.save();
  
    var text_1 = "5ZOO5ZGAIQ==";
    var text_2 = "6LWw6ZSZ5ZWmfg==";
    var size = parseInt(info.smallWidth/2);
    ctx.font = "bold " + size+"px" + " 'Microsoft Yahei','Noto Sans',sans-serif";
    ctx.textAlign = "center";
    ctx.textBaseline = "center";
    ctx.fillStyle = "#444";
    ctx.fillText(b64DecodeUnicode(text_1), info.left+info.largeWidth/2, info.top+info.largeHeight-info.middleHeight/2-size*4/5);
    ctx.fillText(b64DecodeUnicode(text_2), info.left+info.largeWidth/2,info.top+info.largeHeight-info.middleHeight/2+size/3);

    ctx.strokeStyle = "rgba(77, 77, 77, 0.25)";
    ctx.lineCap = "round";
    ctx.lineJoin = "round";
    ctx.lineWidth = 6;
    ctx.strokeRect(info.left+info.largeWidth/4, info.top+info.largeHeight-info.middleHeight*5/6, info.largeWidth/2, info.middleHeight/2);

    ctx.restore();
  };
}

function b64DecodeUnicode(str) {
  return decodeURIComponent(Array.prototype.map.call(atob(str), function(c) {
        return '%' + ('00' + c.charCodeAt(0).toString(16)).slice(-2);
    }).join(''));
}
